import React, { useState } from "react";
import { Text } from "../atomes";

const Login = () => {
  const [formulaire, setFormulaire] = useState("connexion");

  return (
    <div className="m-20 border-2 rounded-md border-[#8C8C8C] bg-slate-300">
      <div className="w-full h-14 flex flex-row justify-around items-center">
        <div onClick={() => setFormulaire("connexion")}>
          <Text.h3>Connexion</Text.h3>
        </div>
        <div onClick={() => setFormulaire("inscription")}>
          <Text.h3>Inscription</Text.h3>
        </div>
      </div>
    </div>
  );
};

export { Login };
